import React from 'react';

const About = () => (
  <section className="about">
    <h2>About Me</h2>
    <p>
      I'm a motivated Computer Science student at SDSU with a passion for software development,
      automation, and robotics. With a background in the U.S. Navy, I bring discipline and
      leadership to my technical projects.
    </p>
  </section>
);

export default About;
